import React, {Component} from 'react';
import {Route} from 'react-router-dom';
import Buyersignup from './Buyersignup';
import Ownersignup from './Ownersignup';
import Existingusersignin from './Existingusersignin';
import Letseat from './Letseat';
import Home from './Home';
import NavBar from './NavBar';
import Ownerlogin from './Ownerlogin';
import Buyerprofile from './Buyerprofile';
import Ownerprofile from './Ownerprofile';
import Searchitem from './Searchitem';
import Orderitem from './Orderitem';
import Cart from './Cart/Cart';
import Orders from './Orders/Orders';
import PastOrders from './PastOrders/PastOrders';
import Menu from './Menu/Menu';
import OwnerRestaurantMenu from './OwnerRestaurantMenu/OwnerRestaurantMenu';
import RestaurantOrders from './RestaurantOrders/RestaurantOrders';


// import Login from './Login/Login';
// import Home from './Home/Home';
// import Delete from './Delete/Delete';
// import Create from './Create/Create';
// import Navbar from './LandingPage/Navbar';
//Create a Main Component
class Main extends Component {
    render(){
        return(
            <div>
                {/*Render Different Component based on Route*/}
                {/* <Route path="/" component={Navbar}/>
                <Route path="/login" component={Login}/>
                // <Route path="/home" component={Home}/>
                <Route path="/delete" component={Delete}/>
                <Route path="/create" component={Create}/> */}
                <Route path="/" component={NavBar}/>
                <Route path="/signup" component={Buyersignup}/>
                <Route path="/ownersignup" component={Ownersignup}/>
                <Route path="/login" component={Existingusersignin}/>
                <Route exact path="/search" component={Letseat}/>
                {/* <Route exact path="/" component={Home}/> */}
                {/* <Route exact path="/home" component={Home}/> */}
                <Route path = "/ownerlogin" component = {Ownerlogin}/>
                <Route path = "/ownerprofile" component = {Ownerprofile}/> 
                <Route path = "/userprofile" component = {Buyerprofile}/>     
                <Route exact path="/searchitem" component={Searchitem}/> 
                <Route exact path="/orderitem" component={Orderitem}/> 
                <Route exact path="/cart" component={Cart}/> 
                <Route exact path="/menu" component={Menu}/> 
                <Route exact path="/userorder" component={Orders}/> 
                <Route exact path="/userpastorder" component={PastOrders}/> 
                 <Route exact path="/restaurantorders" component={RestaurantOrders}/> 
                 <Route exact path="/ownerrestaurantmenu" component={OwnerRestaurantMenu}/>   

            </div>
        )
    }
}
//Export The Main Component
export default Main;
